import { useDispatch } from "react-redux";
import { setDarkMode } from "../store/settings";
import { MainMenuBox } from "../styles/Menu";
import { MenuButton } from "./buttons/MenuButtonsY";
import { FormLogin } from "./forms/FormLogin";

export const MenuHidden = ({ isOpen }: any) => {
  const dispatch = useDispatch();
  return (
    <MainMenuBox theme={isOpen}>
      <MenuButton
        img={"ordersHistory"}
        label={"History"}
        nav={"OrdersHistory"}
      />
      <MenuButton img={"myLists"} label={"My lists"} nav={"MyLists"} />
      <MenuButton
        img={"darkMode"}
        label={"Dark mode"}
        onClick={() => dispatch(setDarkMode((state) => !state))}
      />
      <MenuButton
        img={"languages"}
        label={"Language"}
        onClick={() => console.log("x")}
      />
      <FormLogin />

      {/* <MenuButton img={"logout"} label={"logout"} /> */}
    </MainMenuBox>
  );
};
